品質保証のＢＭＷ純正部品<br>
E71/X6用　ラゲージ・コンパートメント・ネット<br>
<BR>
適合：パーセルレール装着車<BR> 
ラゲージルームに縦位置に取り付けて、テールゲート開閉時に荷物が崩れるのを防ぎます。<BR>
ネットには分割されたポケットがあり、地図や本などの小物を収納できます。<img src="https://image.rakuten.co.jp/bmp/cabinet/04998905/imgrc0068102056.jpg"><br><br>


