品質保証のＢＭＷ純正部品<br>
Z4/左ハンドル用　Ｍフロアマットです。<br>
<BR>
ブラックとグレーの格子柄のシックなフロアマットです。<br>
運転席と助手席に”Ｍ”のロゴマークが付いたスポーティーな印象のマットです。<BR>
<BR>
■特注品<br>■納期：6週間前後<br><br>
